// this script takes lines of Lisp or Scheme code from its
// stdin and produces an indented version thereof on its
// stdout

var lispKeywords = {
  "Last modified": "2017-12-12",

  "block": 0,
  "call-with-input-file": 1,
  "call-with-output-file": 1,
  "case": 1,
  "defpackage": 1,
  "defun": 2,
  "destructuring-bind": 2,
  "do": 2,
  "do*": 2,
  "dolist": 1,
  "dotimes": 1,
  "ecase": 1,
  "etypecase": 1,
  "eval-when": 1,
  "flet": 1,
  "handler-bind": 0,
  "if": 2,
  "labels": 1,
  "lambda": 1,
  "let": 1,
  "let*": 1,
  "let-values": 1,
  "letrec": 1,
  "loop": 0,
  "multiple-value-bind": 2,
  "prog1": 1,
  "typecase": 1,
  "unless": 1,
  "unwind-protect": 1,
  "when": 1,
  "with-input-from-string": 1,
  "with-open-file": 1,
  "with-open-socket": 1,
  "with-open-stream": 1,
  "with-output-to-string": 1,
  "with-slots": 2
}

function numLeadingSpaces(s) {
  //if (s.match(/^\s*$/)) {
  //  return 0;
  //} else {
  s = s.replace(/^(\s*).*/, '$1');
  s = s.replace(/\t/g, '        ');
  return s.length;
  //}
}

function stringTrimBlanks(s) {
  s = s.replace(/^\s*/, '');
  s = s.replace(/\s*$/, '');
  return s;
}

function literalTokenP(s) {
  return !!s.match(/^[0-9#"]/);
}

function getLispIndentNumber(s) {
  var n;
  s = s.toLowerCase();
  if (n = lispKeywords[s]) {
    return n;
  } else if (s.match(/^def/)) {
    return 0;
  } else {
    return -1;
  }
}

function pastNextAtom(s, i) {
  var n = s.length;
  while (true) {
    if (i >= n) {
      return n;
    } 
    var c = s[i];
    if (c === '\\') {
      i++; i++;
    } else if (c.match(/[ \t\(\)\[\]"'`,;]/)) {
      return i;
    } else {
      i++;
    }
  }
}

function calcSubindent(s, i) {
  var n = s.length;
  var j = pastNextAtom(s, i);
  var deltaIndent = 0;
  var lispIndentNum = -1;
  if (j === i) {
    ;
  } else {
    var w = s.substring(i, j);
    if (i >= 2 && s[i-2].match(/['`]/)) {
      ;
    } else {
      var lispIndentNum = getLispIndentNumber(w);
      if (lispIndentNum == -2) {
        ;
      } else if (lispIndentNum == -1) {
        if (j < n) {
          deltaIndent = j - i + 1
        } else {
          deltaIndent = 1
        }
      } else {
        deltaIndent = 1
      }
    }
  }
  return {
    deltaIndent: deltaIndent,
    lispIndentNum: lispIndentNum,
    nextTokenIndex: j
  }
}

var defaultLeftI = -1;
// var leftI = 0;
// var parenStack = [];
// var insideStringP = false;

function indentLine(currLine, leftI, parenStack, insideStringP) {
  var leadingSpaces = numLeadingSpaces(currLine);
  console.log("PS", parenStack, currLine, leadingSpaces);
  var currLeftI;
  if (insideStringP) {
    currLeftI = leadingSpaces;
  } else if (parenStack.length === 0) {
    if (defaultLeftI === -1) { defaultLeftI = leadingSpaces; }
    leftI = defaultLeftI;
    currLeftI = leftI;
  } else {
    currLeftI = parenStack[0].spacesBefore;
    if (parenStack[0].numFinishedSubforms < parenStack[0].lispIndentNum) {
      currLeftI += 2;
    }
  }
  currLine = stringTrimBlanks(currLine);
  // if (currLine !== "") {
  //   for (var i = 0; i < currLeftI; i++) {
  //     process.stdout.write(' ');
  //   }
  //   process.stdout.write(currLine);
  // }
  // process.stdout.write('\n');
    
  var escapeP = false;
  var tokenIntersticeP = false;
  var i = 0;
  function incrFinishedSubforms() {
    if (!tokenIntersticeP) {
      if (parenStack.length > 0) {
        parenStack[0].numFinishedSubforms++;
      }
    }
    tokenIntersticeP = true;
  }
  while (i < currLine.length) {
    var c = currLine[i];
    if (escapeP) {
      escapeP = false; i++;
    } else if (c === '\\') {
      tokenIntersticeP = false; escapeP = true; i++;
    } else if (insideStringP) {
      if (c === '"') { insideStringP = false; incrFinishedSubforms(); } i++;
    } else if (c === ';') {
      incrFinishedSubforms(); break;
    } else if (c === '"') {
      incrFinishedSubforms(); insideStringP = true; i++;
    } else if (c.match(/[ \t]/)) {
      incrFinishedSubforms();
      i++;
    } else if (c.match(/[\(\[]/)) {
      incrFinishedSubforms();
      var si = calcSubindent(currLine, i+1);
      parenStack.unshift({ spacesBefore: 1 + i + currLeftI + si.deltaIndent,
        lispIndentNum: si.lispIndentNum,
        numFinishedSubforms: -1
      });
      tokenIntersticeP = true;
      var iNext = i+1;
      if (si.nextTokenIndex > iNext) {
        iNext = si.nextTokenIndex;
        tokenIntersticeP = false;
      }
      i = iNext;
    } else if (c.match(/[\)\]]/)) {
      tokenIntersticeP = false;
      if (parenStack.length > 0) {
        parenStack.shift();
      } else {
        leftI = 0;
      }
      i++;
    } else {
      tokenIntersticeP = false; i++;
    }
  }
  console.log(99, leftI, currLeftI, parenStack, leadingSpaces);
  // currLeftI += leadingSpaces;
  incrFinishedSubforms();
  // return currLeftI;
  return [currLeftI, parenStack, insideStringP];
}

